import { default as footer } from './components/Footer';


/*const navbar = window.location.pathname.includes("/employee") ? <NavBar /> : <NavBar />;*/
const navbar = <NavBar />

const App = () => (
  <div>
    {navbar}
    <Main /> 
    {footer}
  </div>
)

export default App;
